INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (1,'【完全成果報酬】火災保険申請サポート','【インタビュー動画】\r\nhttps://youtu.be/9QvRboofK70\r\n\r\n日本人の８０%以上の方は本来もらえるはずの火災保険金を受け取りもれてしまっております。\r\n大きな地震や火事が起きないと保険金をもらえないと誤解されている方が非常に多いのですが、小さな損傷でも保険金を受け取ることが可能です！\r\n\r\n皆様には弊社の「プロによる物件の無料調査」を受けたいお客様のご紹介をお願いいたします！調査は当方にて無料で行います。対象の方は、火災保険にご加入の建物を所有をされている方です。\r\n※修理を必要としていない綺麗に見える物件でも、プロが調査すると約９割の物件で保険金を受け取ることができます！\r\n※保険法の通り、受け取られた保険金の使用用途は自由ですので修理しても修理しなくて\r\nもどちらでも問題はありません。（弊社にて修理もお受けできます。）\r\n\r\n【条件】\r\n・風災保証が入っている火災保険に入っていること\r\n・一戸建て、ビル、工場、大小問わず建物の所有権を丸々お持ちのお客様\r\n\r\n※月収１００万円以上稼がれていらっしゃる方が弊社には複数名いらっしゃいます。やり方などもお伝えさせていただきます。詳しくは面談時にお話させてください！','・５０%契約の場合:おりた保険金額全体の１５%（税込）\r\n・４０%契約の場合:おりた保険金額全体の１０%（税込）\r\n・無料修繕ご希望の場合:おりた保険金額全体の４%（税込）\r\n\r\n【例】サポート費用５０％契約のお客様を４名紹介し、その全員が１００万円の保険金を受給された場合の紹介報酬金額：１００万円×１５％×４名＝６０万円（税込）\r\n\r\n※業者への報酬率を４０%か５０%にしていただくかは、紹介元の紹介者様が決めていただく形となります。そのため、紹介情報を入力いただく際に必ず「４０％採用です」「５０％です」などとご記入いただきますようよろしくお願い申し上げます。',3,'2020-11-05 05:44:45','2021-12-02 22:56:48',2,'1PuEMub-8DCM_foNgp8wtb5AyjvdCSlRG5L0NHJ0VnCE',NULL,'全国どこでも可能','月末締め翌１５日払い','火災保険申請サポートを受けたい方をご紹介ください。一戸建やビルや工場など建物を丸々一棟お持ちの方限定となります。','１件あたり約１０万円','口コミ・チラシ・サイト作成など基本的になんでも可能です。','口コミ・チラシ・サイト作成など基本的になんでも可能です。',3,'有限会社YOSHIプランニング','https://kasaihoken-support.com/','お客様ご本人のみで火災保険の申請を行うより、弊社に任せていただいたほうが受給保険金額が上がる可能性が高いことと、保険金受給できる可能性が高くなること。\r\n全国対応していること、保険金受給までのスピード、一級建築士と弁護士が監修していることが他社と比べての強みのポイントになります！');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (2,'月収１００万円以上を本気で稼ぎたい営業人材をご紹介ください！','「口コミ複業パラキャリ」の総代理店として本業・複業問わず、本気で稼ぎたい営業マンをご紹介ください！\r\n代理店登録費は１０万円（税込）、月額費用は０となります。（営業経験２年以上の方限定）\r\n\r\n「口コミ複業パラキャリ」では掲載できない案件を超好条件でお伝えし、現役の年収１億円以上の営業のプロが稼ぐためのサポートをします！','ご紹介していただいた方が代理店登録すると５万円（税込）',3,'2020-11-05 05:44:45','2021-08-15 17:49:02',2,'1zZZWY54IZThSchctYLb7ymWaNcLeOFCjPYJFruneYcM',NULL,'全国どこでも可能','月末締めの翌月１５日払い','「口コミ複業パラキャリ」の総代理店として本気で稼ぎたい営業マンをご紹介ください。「口コミ複業パラキャリ」では掲載できない稼げる案件等を好条件でお伝えし、現役の年収１億円以上の営業のプロが稼ぐためのサポートをします！','ご紹介していただいた方が代理店登録すると５万円（税込）','口コミ','口コミ',15,'株式会社パラレルキャリア','#なし','・「口コミ複業パラキャリ」には掲載できない極秘案件のお伝え\r\n・現役の年収１億円以上の営業マンによるサポート');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (8,'【故障車でも買取可】中古トラック買取サービス','中古トラックを売りたい方をご紹介ください。動かなくなってしまったトラックでも買い取り可能です。廃棄料金がかからなくなったとのことで喜んでいただいたお客様もたくさんいらっしゃいます。買い取りさせていただいたトラックは、業者専門の市場で販売いたします。','（市場での販売価格ーお客様からの買い取り価格―事務経費）×１０％＝報酬（税込）　　　　　　　　　　　　　　　　　　　\r\n神戸からお客様のもとへ向かいますので、事務経費は地域によって変わりますが大体３～５万円程になります。\r\n【報酬例】お客様から１００万円で買い取ったトラックが市場で２０３万円で販売できた場合の報酬金額\r\n（２０３万円ー１００万円ー３万円）×１０％＝１０万円（税込）',3,'2021-01-08 03:47:09','2021-12-02 23:54:05',2,'1D8uQz95EBgEGUgCXwK4Y_Nu6_Jemg9aKsdmELw0mCsE',NULL,'全国どこでも可能','月末締め翌１５日払い','中古トラック買取サービス','弊社利益の１０％（税込）','口コミ・チラシ・サイト作成など基本的になんでも可能です。','口コミ・チラシ・サイト作成など基本的になんでも可能です。',9,'トラックオフ','https://www.truckoff.jp','①しつこい電話営業は一切ありません\r\n②買い替えOK\r\n③スピーディーな対応\r\n④即日現金にてお支払い\r\n⑤安心！無料査定\r\n⑥全国から買い取り可能\r\n⑦車両の看板、社名消しも承ります\r\n⑧名義変更\r\n⑨事故車や不動車の買い取りも可能\r\n⑩書類の手続き代行\r\n⑪代表が直接対応\r\n⑫２４時間受付');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (9,'プロパンガス','プロパンガスをご利用されている一戸建ての家主様、もしくはビルやアパートの家主様をご紹介ください。そのエリアで一番安い弊社が提携をさせていただいているガス会社との料金比較をさせていただきます。\r\nお客様が弊社が提携するガス会社に切り替えていただいた場合に紹介料をお渡しいたします。','１件あたり１～４万円（税込）。どこのガス会社に切り替えるかによって報酬金額が変わってきますので、報酬に関しては都度ご確認ください。',4,'2021-01-08 04:27:45','2021-03-11 19:23:26',2,'1BZ1Q3u247jI1ba1_5ZEAfBcgSD9C5OirkpB5oq-CIA8','yosuke.tanaka.78@gmail.com','【東北】宮城県・福島県・山形県【関東】東京都・埼玉県・千葉県・神奈川県・群馬県・栃木県・茨城県【甲信越】山梨県・長野県【中部】静岡県・愛知県・岐阜県・三重県【北陸】石川県・福井県【近畿】大阪府・京都府・奈良県・滋賀県【中国】岡山県・広島県【四国】愛媛県・高知県【九州】福岡県・鹿児島県・熊本県・大分県','月末締め翌々月１５日払い','プロパンガスを使われている家主様をご紹介ください！','１件あたり１万円～４万円','口コミ・チラシ・サイト作成など基本的になんでも可能です。','口コミ・チラシ・サイト作成など基本的になんでも可能です。口コミ以外の場合はご相談ください。',2,'株式会社エネライフ','なし',NULL);
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (10,'賃貸物件紹介','引越しする方をご紹介ください。  ネットに載ってる物件や未公開物件を安くご案内します。  また他社で内見した物件の見積もりを共有して頂ければ、他社より安くご案内させていただきます。','最大報酬額は家賃の５０％です。\r\n\r\nお友達やネットで集客し見込み客をご紹介ください！\r\n\r\n物件により大家さんから頂ける広告費（AD）によって最大報酬額は変動し、最低でも家賃２０％の報酬になります。\r\n\r\n例：家賃１０万円の物件の場合、２万円の報酬になります。（AD２００%の場合、５万円になります）',1,'2021-01-19 06:18:51','2021-11-23 02:40:37',2,'1oc3oO6GrN2oclEtVfV2vSLypoGZM_wxPbvV3tCTcpCI',NULL,'全国どこでも可能','月末締め翌々月１５日払い','引越しする方をご紹介ください。 ネットに載ってる物件や未公開物件を安くご案内します。  また他社で内見した物件の見積もりを共有して頂ければ、他社より安くご案内させていただきます。','家賃の２０％～５０％（税込）','お任せいたします。','口コミ・チラシ・サイト作成など基本的になんでも可能です。口コミ以外の場合はご相談ください。',16,'渋谷に本社がある企業です。詳細御希望の方は『掲載主から詳細を聞く』を押してください。','#なし','同じ賃貸物件でも必ず他社よりも必ず安い値段で契約が可能です！');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (11,'マイホームを購入検討の方をご紹介ください！','マンションや戸建てを買いたい方をご紹介ください。土地探しから注文住宅まで精一杯にお手伝いさせていただきます。','売買利益の２５％（税込）が報酬です。\r\n\r\n売買利益とは事務手数料１０万円を引いた金額から２５％（税込）となり、物件によって契約書作成や契約事務手数料がかかる場合もあります。\r\n\r\n例：価格３０００万円の物件で売主と買主からそれぞれ３％の手数料の場合、４２．５万円の報酬になります。',4,'2021-01-19 06:33:35','2021-04-09 17:10:40',2,'1HUspeveISVR2i4R3ZONLL_DjgGU2hop3rdW1mbhQt6U','yosuke.tanaka.78@gmail.com','全国どこでも可能','月末締め翌々月１５日払い','マンションや戸建てを買いたい方をご紹介ください。土地探しから注文住宅まで精一杯にお手伝いさせていただきます。','売買利益の２５％（税込）','口コミ・チラシ・サイト作成など基本的になんでも可能です。','口コミ・チラシ・サイト作成など基本的になんでも可能です。口コミ以外の場合はご相談ください。',17,'渋谷に本社がある企業です。詳細は面談時にお伝えいたします。','なし','・仲介手数料が物件によって最大無料です\r\n・物件価格を割引交渉します\r\n・ローンを組む際に低金利の銀行をご紹介します\r\n・リフォームされる際は安くご提案します\r\n・面倒な手続きやネットに掲載されている物件はほぼ全てご紹介可能です\r\n・デザインの良い納得のいく建物をご提案します');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (12,'生命保険・医療保険・節税保険','新規の保険加入にご興味のある個人の方、もしくは法人を御紹介ください。\r\n御紹介可能な保険銘柄は、東京海上あんしん生命・メットライフ生命・アクサ生命・プルデンシャル生命です。','月額保険料金×１〜１.５ヶ月（税込）\r\n【個人の平均保険料は月２〜３万円・\r\n法人の平均保険料は月２０～３０万円（会社の大きさによってその差は非常に大きい）】\r\n\r\n※顧客が２年以内に保険解約した場合、一部報酬返礼の可能性有り',3,'2021-01-21 21:48:50','2021-11-23 02:41:36',2,'1svC4WFn4h-GXfxXW64G9l0wYjEvaLUZFpbewNoiA6hA',NULL,'全国どこでも可能','（保険申し込み➡審査➡契約成立）契約成立後の月末締め翌月１５日払い','保険加入に興味のある個人・法人をご紹介ください！','月額保険料金×１ヶ月（税込）','口コミ','口コミ・チラシ・サイト作成など基本的になんでも可能です。口コミ以外の場合はご相談ください。',6,'株式会社パラレルキャリア','#なし','保険はよく分からずに入っている方がほとんどです。必要補償額はいくらなのか、業界内で一番お得な保険なのか、掛け捨てか貯蓄型か、法人であればそれが経費になるのか・・・セカンドオピニオンも兼ねて一度見てもらうだけでも価値があります。\r\n\r\n個人では、生命保険料控除を利用する以外にもうまく生命保険を利用することで相続税を１０分の１以下にする方法もあります。\r\n\r\n法人では、生命保険を使うことで経費を作成し、法人税の支払いを減らしつつ将来の退職金を積み立てたり、赤字転落時の損失補償を行うことができます。');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (13,'ブランド品転売で稼ぎたい方をご紹介ください！','リサイクルショップやフリマアプリで古着やブランド品を買い付けて、フリマアプリで販売する物販手法を教えるスクールです。\r\n\r\n設立１年半で生徒数は２００名を越え、副業でも転売月収５０万円以上の方や起業して月収１００万円以上稼ぐ方を多く輩出してきました。\r\n\r\nいわゆる情報商材ではなく、バイヤー養成の様なスクールです。\r\n\r\n日本全国の講師が仕入れに同行して目利きを指導します。\r\n\r\nYouTubeでも情報発信しているのでこちらを見て頂ければイメージがつきやすいかと思います。','１０万円（税込）',4,'2021-01-21 23:18:18','2021-05-23 21:24:41',19,'1cHvIotiPDNsSNYm5DJwJUCfhINrYvf9kVUY9uyAVoNk','taibenjaminkuzuhara@gmail.com','日本全国どこでも','末締め翌月末日払い','リユースアパレル（古着やブランド品）の転売で稼ぎたい方をご紹介ください！','１０万円','口コミ等なんでもOKです。','口コミ等なんでもOKです。',12,'株式会社ノーガード','https://www.youtube.com/channel/UCaQpqlrKICzBnSecai6NuEw/videos','素人から月収１００万円以上を目指すことができます。');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (14,'会社を退職・転職する方をご紹介下さい！','退職もしくは転職する方をご紹介ください！\r\n失業手当をもらえる期間が３ヶ月から１０ヶ月もしくは１８ヶ月になります。','原則お客様のお支払い金額の５％をストックでお支払い\r\n短期コース：１７５０円/月✖️１０ヶ月\r\n長期コース：１７５０円/月✖️１８ヶ月\r\n一括の場合は総額は割引されますがお客様のお支払い金額の５％をお支払いになります。',4,'2021-01-26 00:51:17','2021-02-03 05:59:54',28,'1205D3zoGFQYloy0cuNw4t3AIyB5gqY3mjBPkceLK33M','avalue.create@gmail.com','対面（大阪）ZOOM（全国）','末締め１５日払い','退職コンサルティング','１７５００円もしくは３１５００円','対面、ZOOM','口コミ',10,'AVALUE　CREATE合同会社','https://linktr.ee/onepacksyatyo','失業手当をもらえる期間が長くなります。');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (15,'補助金・助成金を申請したい方をご紹介ください！','補助金・助成金は地域限定のもの含めると、常時５万種類以上あります。必ず何かが見つかりますが、時期や応募書類など制度ごとにバラバラで把握するのは不可能です。\r\nそこで、そのときに一番対象者が多いのではないかという制度をご提案しますので、ぜひクライアント様にご提案下さい。クライアント様からは合格発表時に申請サポート手数料を頂戴いたします。\r\n\r\n令和３年オススメの制度：\r\n・小規模事業者持続化補助金(最大１００万円、４分の３)ホームページや広告費が返ってきます。\r\n・事業再構築補助金(最大１億円、３分の２等)改装、建築、宣伝広告費等が返ってきます。\r\n・キャリアアップ助成金（正社員に昇格させると５７万円もらえます）\r\n・人材開発支援助成金（社員に研修を受けさせると費用の３割から１０割が返ってきます）\r\n\r\n【申請サポート手数料の具体例】\r\n・持続化補助金　２０％（税込）\r\n・事業再構築補助金　２０％（税込）\r\n・人材再開発支援助成金　２０％（税込）\r\n・キャリアアップ助成金　無料（無料窓口を案内）','報酬はお客様からいただいた料金（税込）の２０％（税込）となります。\r\n【報酬具体例】ご紹介いただいたお客様が１００万円の持続化補助金を受け取られた場合\r\n１００万円（税込）×２０％（申請サポート手数料）×２０％＝４万円（税込）\r\n\r\n\r\nそれぞれの制度ごとによって申請サポート料金が違っておりますので、詳細は都度ご確認ください。\r\n\r\nお客様にヒアリングシートをお渡しし、その御返答から申請できる補助金・助成金を試算します。　',4,'2021-01-26 18:39:17','2021-11-17 21:58:53',27,'1PpNXM9TT4arZn979c_aWS9BqeuhdXLjw3W0cDQXk4j8',NULL,'全国','月末締めの翌１５日払い','補助金・補助金の申請をお任せしたい中小企業もしくは個人事業主をご紹介下さい！　全国全業種の対応です。','お客様からいただいた料金の２０％（税込）','お任せいたします','お任せいたします',30,'株式会社G.C.E','#なし','・着手金０\r\n・平均合格率を常に上回っている\r\n・料金０で提案できる補助金・助成金がある\r\n・合格までではなく入金までのサポート');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (16,'脱毛サロンにお得に通いたい方をご紹介ください！（東京）','メンズ•レディース問わず脱毛にご興味ある方をご紹介ください！当店は完全招待生の脱毛サロンとなっております。 \r\n\r\n※お客様には店頭で「パラキャリ割で」と伝えていただくようにご案内をお願いいたします！！\r\n\r\n✭２０２１メンズ「パラキャリ割特別価格」（１回あたり）\r\n\r\n全顔&首=１万円\r\n両わき=３０００円\r\nVIO=１万２０００円 (VIO単品は各５０００円)\r\n両腕=１万２０００円\r\n両足=１万５０００円(ひざ上、ひざ下 各７０００円)\r\nお腹=８０００円\r\n胸=８０００円\r\n背中=１万円\r\n\r\nまとめて割引\r\n全身=６万円\r\n全身(顔 or VIO抜き)=５万５０００円\r\n両腕+両足=２万５０００円\r\n全顔&首+両足=２万３０００円\r\n\r\n\r\n✭２０２１レディース「パラキャリ割特別価格」（１回あたり）\r\n\r\n全顔&首=６０００円\r\n両わき=３０００円\r\nVIO=７０００円(VIO単品は各３０００円)\r\n両腕=７２００円\r\n両足=７２００円(ひざ上、ひざ下 各４０００円)\r\nお腹=５０００円\r\n胸=５０００円\r\n背中=６０００円\r\n\r\nまとめ割引\r\n全身=２万５０００円','お客様からいただいた金額の７．５%をお支払いいたします。',4,'2021-01-28 21:21:02','2021-08-15 23:00:13',20,'1w8IqhszwZrLzH8Zt5hhs2_JA0oktpwE3unT9QxlUOiM',NULL,'東京都渋谷区代々木３丁目','月末締めの翌月の１５日払い','メンズ•レディース問わず脱毛にご興味ある方をご紹介ください！','契約していただいた内容の７．５%をお支払いいたします。','お任せいたします。','お任せいたします。',8,'atlantis beauty','https://www.instagram.com/atlantis_beauty_group','他店よりも安く脱毛をすることができます。');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (17,'テスト','テスト','テスト',4,'2021-02-01 00:08:06','2021-02-01 00:09:09',2,'1C0PzP81ELjDEA9nC47CF5q6USAcZs8MVblD-88H2IOI',NULL,'テスト','テスト','テスト','テスト','テスト','テスト',13,'テスト','テスト','テスト');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (18,'通信費をコスト削減したい法人をご紹介ください！','既に通信機器がありコストを削減されたい方、もしくは新しくオープンする事業所をご紹介ください。\r\n弊社がキャリアやメーカーと交渉し特価でご提供させていただきます。','■フレッツ光  ・料金 月額４０００円台（エリア、タイプによって微差あり） \r\n報酬：１２５００円  \r\n\r\n■ソフトバンク携帯（５０GB、カケホ）   ・料金 月額４４８０円　 端末代金別途  \r\n報酬：１台２０００円\r\n  ※１０台以上の場合、 特別プラン有 キャリアと交渉し弊社独自の毎月報酬方式へ\r\n\r\n  ■無制限ポケットWi-Fi （１日３GB以上利用時制限有）  ・料金 月額　３４８０円 端末代金込み  \r\n報酬：２０００円\r\n\r\n  ■データ２０GBタブレット （iPad、Android）  ・料金 月額４４８０円 端末代金込み  \r\n報酬：２０００円\r\n \r\n■複合機 （メイン京セラ）  ・料金 本体代は 基本６年リース月額１２０００円   カウンター 白黒０．７円、カラー７円  \r\n報酬：２５０００円\r\n\r\n  ■UTM（セキュリティ機能）・料金 本体代は 基本的に６年リース月額１２０００円   \r\n報酬：２５０００円 \r\n\r\n■電話工事、LED工事、パソコン、防犯カメラ  \r\n報酬：設置内容によって変わるため粗利の１０%',4,'2021-02-01 23:15:28','2021-08-15 21:00:04',25,'1lslfopg4C0mZnmzlmYYAO8HxoGyp3lU2TocMRwfkXSQ','n.hashimoto@nncom.co.jp','全国','納品月・開通月の翌々月１５日','通信機器が必要orコスト削減をしたい法人様・個人事業主様をご紹介ください','一度ご紹介いただくと通信機器が契約になる度に報酬に繋がります。全ての商品が１台から契約可能です。※詳細画面をご確認ください','お任せいたします','お任せいたします。',10,'日本ネットワークコミュニケーションズ株式会社','http://nncom.co.jp/','通信費削減！\r\n要望を弊社にお伝えいただくだけで弊社がキャリアメーカーから都度特別条件を取得いたします。');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (19,'【無料】転職先紹介・転職サポート','【インタビュー動画】\r\n)https://youtu.be/6vXflnarCAs\r\n\r\n転職もしくは就職をしたい方をご紹介ください。現在フリーター・無職の方でもOKです。\r\n正社員と契約社員の転職先企業の紹介は関東＆関西＆九州、派遣社員に関しては関東のみが紹介可能エリアとなっております。面談はオンラインでも可能です。\r\n\r\n※転職先をご紹介できない方\r\n・５０歳以上の方\r\n・関東＆関西＆九州以外の勤務地をご希望の方\r\n・正社員以外の仕事をご希望の方','紹介先企業から弊社に振り込まれた紹介フィーの過去最低は３０万円、過去最高は２４０万円となっております。その紹介フィーの２０％を紹介報酬としてお支払いさせていただきます！\r\n\r\n【企業から弊社への紹介フィーが２４０万円の場合】\r\n２４０万円×２０％＝４８万円\r\n\r\n紹介先企業からの紹介フィーは転職者がキャリアチェンジなのかキャリアアップなのかによって違ってきます。\r\n\r\n※もし１ヶ月以内に退社をしてしまった場合は報酬の１００％を支払うことができません。\r\n※３ヶ月以内に退社をしてしまった場合は報酬の５０％を支払うことができません。\r\n\r\n詳しくは添付動画に記載させていただいておりますのでご覧ください。\r\n\r\n※ご紹介いただける際には、ご紹介いただける方のラインIDを詳細欄にご記載お願いいたします。',3,'2021-02-03 05:55:41','2021-12-03 22:43:03',2,'1VEUgIZnUFOYHrSpUndUSaClOvBvnD81CGO6hu7C4wHU',NULL,'全国どこでも可能（関東＆関西＆九州での勤務をご希望の方限定の募集となります）','ご紹介していただいたお客様の入社月の翌々月の１５日','転職・就職を考えられている方をご紹介ください！弊社が紹介した企業に転職された場合に紹介報酬をお渡しさせていただきます。','１件あたり約２５万円','口コミ','口コミ',2,'株式会社NEWGATE','https://youtu.be/ioU4P6N79qo','【お客様メリット】\r\n・就職もしくは転職をキャリアコンサルタントが何回でも無料サポート\r\n・お客様は一切料金がかからない\r\n・希望職種をしっかりとヒアリング\r\n・履歴書や職務経歴書の作成や面接練習をキャリアアドバイザーが完璧にサポート\r\n\r\n【弊社の強み】\r\n・内定入社の月間決定率が２３．３％～４２．０％と高い（平均は１５～２０％）\r\n・求人社数約３８００社');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (20,'中国輸入転売で稼ぎたい方をご紹介ください！','中国輸入は、「安く仕入れて高く売る」商売の基本が最もやりやすいビジネスになります。\r\n一例ですが、４００円で仕入れたものが３０００円で販売され、２０００円の利益になる。４００円の投資に対して２０００円の利益を得られ、リターン率が５倍。中には１０倍になったりする商品も沢山あります。つまり初心者にとっては、最初の投資は少なくし利益を最大化し収入を増やしやすい特徴があります。\r\n\r\n仕入れはご自身で行っていただく形になりますが、弊社のコミュニティにご参加頂けたら、「出品販売・売れた商品の発送」を完全自動化できます。つまり、やることはリサーチして仕入れをするだけです。\r\n\r\nコンサル生は、大手企業、公務員、美容師、主婦の方、いろんなキャリアの方が在籍しており、毎月２０万〜５０万の収益を上げられております。\r\n\r\n【こんな方がいたらご紹介下さい】\r\n\r\n＊副収入を得たい\r\n＊副業を考えていた\r\n＊中国輸入に興味があった','ご紹介していただいた方が契約になれば、紹介料として５万円（税込）をお支払いさせていただきます。',1,'2021-02-10 21:14:43','2021-11-30 00:16:51',32,'1_iCZZndurRtPQ0D3VADJW61F354g-7AwxVBTYMMlsyY','nagamantus@gmail.com','全国','契約月の翌々月１５日支払い','サルワカ中国輸入のコンサルティングを受けたい方をご紹介下さい。ネット販売や輸入事業を考えられている方、稼ぎたいと考えられている方をご紹介頂けたらと思います。','５万円（税込）','口コミ・チラシ・サイト作成など基本的になんでも可能です。','特に指定はありません',11,'株式会社MTS','https://preview.studio.site/live/p6aoxrpvWR/1','６ヶ月以内に３０万円利益を作るようなシステムが御座いますのでご安心ください。\r\n出品販売・発送業務など全て自動化しており、忙しい方でも収入を得やすい所が弊社の強みになります。');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (21,'ブランド品の服を定価の最大９９％オフで買える会員サービス','【インタビュー動画】\r\nhttps://youtu.be/_onao9MhilM\r\n\r\n国内のアパレルの市場規模は、１５兆円→１０兆円に縮小するも、人の手に渡ることなく捨てられてしまう服の量が約１００万トン。Yシャツに換算すると４７億着相当と年々増加しています。\r\nアパクルはそういった服と生産者の想いを人々の元へ届けるために、会員に多くの利益を生んでいただきながらアパレルの余剰在庫問題の解決に取り組みます。\r\n\r\nお客様は最低価格ですと（月額）９９００円のみで、何着でも卸価格に１円も上乗せされていない価格で【新品正規品のブランド品】の服を制限数なく購入することができます！\r\n\r\nホームページ：　https://appacle.shop/#company','ご紹介いただいた方が弊社の会員になっていただくと毎月契約プラン金額の１０%（税込）をお支払いいたします。(解約されるまで毎月)',3,'2021-03-02 00:29:57','2021-11-25 20:59:23',2,'109_d8cKbjO1Nnh-0PiEcUupB-ZhvcUOLIR-BVNWhLpU',NULL,'全国どこでも可能','月末締めの翌々月の１５日払い','新品正規品のハイブランドの服を定価の最大９９％オフで買いたい方をご紹介ください！','１件あたり契約プランの１０%(税込)','口コミ','口コミ',4,'株式会社Appacle','https://lstep.app/Y9IoGV','・新品正規品のハイブランドの服を卸価格（定価の９０％～９９％オフ）で買うことができます！\r\n・転売をして利益をだしていただいても、ご自身で着ていただいてもどちらでも可能です！\r\n・プランによっては転売で利益をだすためのサポートを受けることも可能です！');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (22,'賃貸物件をお得に探されている方をご紹介ください！','大阪、兵庫を中心とする近畿エリアでお引っ越しをお考えの方をご紹介いただくお仕事です。\r\n基本的にはお客様を見つけていただきご紹介いただく形になっております。\r\n\r\nその他業務範囲を広く受けていただける場合は研修の後、報酬形態を変更させていただくことも可能です。\r\n\r\n※事務所、テナントなどのご紹介もお受けしております。ご相談ください。','報酬は発生した売上の２５%としております。\r\n相場の金額としましては１ヶ月分の家賃が１０万円の場合、報酬は２．５万円〜となります。（物件により前後に変動致します。）',1,'2021-03-06 21:46:44','2021-08-16 00:36:33',40,'1Ivkx407R6o43VMMUaOgK7orNonwTYG4KwsA-W16-WZo',NULL,'大阪、兵庫、京都','売上金着金した月締め、翌月末支払い','近畿圏内でお引っ越しを考えられている方をご紹介ください。単身、カップル、ファミリーどなたでも可能です。','売上の５０%','口コミ（その他営業方法をお考えの方はご相談ください。）','口コミを推奨しております。その他ご相談あればお気軽にお問い合わせください。',1,'翔星建設株式会社','http://stylee.info/','①仲介手数料０\r\n②オンラインでお部屋さがしができる\r\n③現地集合で内覧ができる\r\n④おしゃれな不動産多数あり\r\n⑤初期費用のお値下げ交渉可\r\n⑥各エリアの格安のライフライン（電気、ガス、ネットなど）を同時手配');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (23,'不動産購入・売却・不動産投資をお考えのお客様を御紹介ください！','不動産の売却や購入、不動産投資をお考えのお客様をご紹介いただくお仕事です。','売買利益の２５%が報酬です。売買利益とは事務手数料１０万円を引いた金額から２５%となり、物件によって契約書作成や契約事務手数料がかかる場合もあります。\r\n\r\n例：価格３０００万円の物件で売主と飼い主から各々３%の手数料の場合、４２．５万円の報酬になります。',4,'2021-03-19 22:48:48','2021-08-16 00:39:07',40,'11KPXFjY-AsepMGoqwdit1z3bYP6VWInyZn6b3rvbnCk','eiyoshi99@gmail.com','主に大阪、兵庫、東京（全国可能です。）','売上金着金した月締め、翌月末支払い','大阪、兵庫中心に不動産の売却や購入をお考えのお客様をご紹介いただくお仕事です。基本的にはお客様を見つけていただきご紹介いただく形になっております。','売買利益の２５%','口コミ（その他営業方法をお考えの方はご相談ください。）','口コミを推奨しております。その他ご相談あればお気軽にお問い合わせください。',12,'翔星建設株式会社','http://shoseikensetsu.co.jp/','各エリアに強い担当と、提携会社がいるので適正価格での取引が可能です！\r\n相見積もりしていただければ確実にお安くできます！');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (24,'決算直前に全額損金で落とせる節税投資商品','会社の決算日直前でも全額損金で落とせるドローン投資に興味のある経営者もしくは個人事業主をご紹介ください。\r\n\r\nレンタルプランは３ヶ月、６ヶ月、１２ヶ月、１８ヶ月と４つあり、事業利益率は６０％・９０％・１０３％・１０５％となっております。最低投資価格は３６０万円で上限はございません。\r\n\r\n詳細に関しては画像をご確認ください。','ご紹介していただいたお客様が購入した金額の１％。\r\n\r\n例.５０００万円を購入した場合\r\n５０００万円×１％＝５０万円(税込)',3,'2021-04-20 23:26:34','2021-11-23 03:01:34',2,'14xm1rh_Ol2xBCTJsniAq_8rGsXvUO5PYQlKcvymAmKc',NULL,'全国どこでも可能','成約月の翌々月１５日','決算直前に全損で落とせる節税投資商品','売上価格の１％','口コミ','口コミ',13,'株式会社ミカタコンサルティング','https://www.mikataconsulting.com','・全額を損金として処理できる\r\n・利回りが確定されている（事業リスクにより左右されない）\r\n・短期間で投資ができ利回りが銀行の約５００倍\r\n・将来のドローン技師に貢献できる');
