INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (30,'高級バッグの染め替え「シューバーリペアサービス」','【インタビュー動画】\r\nhttps://youtu.be/E_708gvNdf0\r\n\r\n傷んだバッグをお持ちの方に、バッグの染め替えをお勧めしていただく業務です。\r\n\r\n縦＋横＋幅４５０㎜未満がSサイズ、７００㎜未満がMサイズ、それ以上のサイズはLサイズです。それぞれ価格は３００００円、４００００円、５００００円となります。\r\n\r\n弊社ではエルメスのバーキンやシャネルのマトラッセ、クロコなど高級と呼ばれるバッグを染め直す専門店を行っております。神戸最高級ホテル「ラスイート神戸ハーバーランド」を始め、様々な企業様にご導入頂いております。\r\n\r\n信頼できる実績があるからこそ、安心して身の回りの方にお勧めしていただけるかと思います。','報酬は６０００～１００００円となります。（サイズにより異なる。S６０００円、M８０００円、L１００００円 ）',3,'2021-06-18 23:38:41','2021-12-04 01:07:59',2,'1a566a2dzxjK7ONcPvskRt4KoFovJOkhEjkRTufiuuSY',NULL,'全国どこでも可能','顧客より入金後1週間～2か月 （施工の進みぐらいにより異なる）','傷んだバッグをお持ちの方に、バッグの染め替えをお勧めしていただくお仕事です。','報酬は６０００～１００００円となります。（サイズにより異なる。S６０００円、M８０００円、L１００００円 ）','口コミ','口コミ',14,'株式会社Shoeber','https://www.shoeber.co.jp/blank-3','・染め替えの技術に長けている職人によって丁寧に染め上げられる。（染め替えは技術による差が出やすい）\r\n・通常断られることが多いクロコ等爬虫類系のバッグ等も染めることができる。\r\n・高級バッグ染め替えの中ではかなり低価格でご利用いただく事が可能である。');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (31,'プロパンガス','cdwdklcmwkm','ijiejcioe',1,'2021-06-20 22:50:33','2021-06-20 22:50:33',2,'1aD7pIfbLKCkH4nlIwduE1b_I8bwKB0ktJqWzStzUpZs',NULL,'全国どこでも可能','月末締め翌々月１５日払い','転職を考えられている方をご紹介ください！弊社が紹介した企業に転職された場合に紹介報酬をお渡しさせていただきます。','1件あたり1万円～3万円','口コミ','deds',NULL,'株式会社NEWGATE','https://youtu.be/ioU4P6N79qo','wdcwddxw');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (32,'表参道勤務で月収１６０万円を目指せるテレアポで働きたい方を御紹介ください！','テレアポ(企業に対して電話をしてアポイントをとる仕事です)業務。\r\n\r\n電話一本で月に１０万円だけ稼ぐもよし！\r\n本気で取り組めば、月１００万円〜１５０万円以上を目指すこともできます！\r\n\r\n日本最強のテレテアポ会社「株式会社セールスクルー」は、\r\n元医学部、元アイドル、(年収ランキング１位の)株式会社キーエンス出身の小林による\r\n「テレアポ代行会社」です。\r\n\r\n３年前からテレアポに特化して始めたテレアポ代行事業を火種に、現在は東証一部上場企業のクライアントまで利用するテレアポ代行事業を主軸に急激に業績を伸ばしています。\r\n\r\nそんな急成長企業の営業パートナーとしてジョインしませんか？\r\n\r\n本気で営業力をつけたい！本気で稼ぎたい！\r\nそんな方、お待ちしております！\r\n\r\n■会社情報\r\n株式会社セールスクルー　\r\n東京都港区南青山５－１０－２\r\n第２青山ハイツ７１０','アポイントの件数と、等級に応じて報酬が決定します。\r\n等級制度は、明確に設定されており、ランクに応じて報酬インセンティブが上がります。\r\n\r\n＜報酬イメージ＞\r\n新人ランク：月収１４万円程度\r\n一般ランク：月収３６万円〜４８万円程度\r\nリーダーランク：月収４８万円〜７８万円程度\r\n管理職ランク：７８万円〜１６０万円\r\n\r\n※１アポイント：７０００円〜１２０００円\r\n※その他等級によりリーダー手当等あり',4,'2021-07-18 23:52:24','2021-10-11 16:40:17',2,'1yemVWBmzg5Ggw5_c667awkj_QVT_Mav0hc4W88fjvd8',NULL,'表参道','月末締め翌月末払い','表参道勤務で月収１６０万円を目指せるテレアポで働きたい方を御紹介ください！','報酬内容  アポイントの件数と、等級に応じて報酬＜報酬イメージ＞ 新人ランク：月収１４万円程度 一般ランク：月収３６万円〜４８万円程度 リーダーランク：月収４８万円〜７８万円程度 管理職ランク：７８万円〜１６０万円  ※1アポイント：７０００円〜１２０００円 ※その他等級によりリーダー手当等あり','口コミ','口コミ',5,'株式会社セールスクルー','https://salescrew.jp','・勤務場所のオフィス(テレアポセンター)は表参道駅徒歩３分(周辺飲食店多数でランチが充実)！\r\n・Wi-Fi環境のオフィス・架電効率が上がるシステム搭載のPCを提供！\r\n・トークスクリプト、営業マニュアル、営業リスト全て完備！研修制度あり！\r\n(通算１００商材以上のテレアポを行ってきた弊社だけの秘伝のテレアポノウハウを全て共有します！)');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (33,'補助金・助成金の無料適正診断サービス','【インタビュー動画】\r\nhttps://youtu.be/pzJ7IPZycMQ\r\n\r\n補助金・助成金は地域限定のもの含めると、常時５万種類以上あります。必ず何かが見つかりますが、時期や応募書類など制度ごとにバラバラで把握するのは不可能です。\r\nそこで、そのときに一番対象者が多いのではないかという制度をご提案しますので、ぜひクライアント様にご提案下さい。クライアント様からは合格発表時に申請サポート手数料を頂戴いたします。\r\n\r\n令和３年オススメの制度：\r\n・小規模事業者持続化補助金(最大１００万円、４分の３)ホームページや広告費が返ってきます。\r\n・事業再構築補助金(最大１億円、３分の２等)改装、建築、宣伝広告費等が返ってきます。\r\n・キャリアアップ助成金（正社員に昇格させると５７万円もらえます）\r\n・人材開発支援助成金（社員に研修を受けさせると費用の３割から１０割が返ってきます）\r\n\r\n【申請サポート手数料の具体例】\r\n・持続化補助金　２０％（税込）\r\n・事業再構築補助金　２０％（税込）\r\n・人材再開発支援助成金　２０％（税込）\r\n・キャリアアップ助成金　無料（無料窓口を案内）','報酬はお客様からいただいた料金（税込）の２０％（税込）となります。 \r\n\r\n【報酬具体例】ご紹介いただいたお客様が１００万円の持続化補助金を受け取られた場合 １００万円（税込）×２０％（申請サポート手数料）×２０％＝４万円（税込） それぞれの制度ごとによって申請サポート料金が違っておりますので、詳細は都度ご確認ください。 お客様にヒアリングシートをお渡しし、その御返答から申請できる補助金・助成金を試算します。',3,'2021-07-25 23:29:36','2021-11-25 21:06:40',2,'1IsoKeSPe3lFli99U9gwh-A39rzQ_MjtGTsUpdI9mst0',NULL,'全国','翌月末','補助金・補助金の申請をお任せしたい中小企業もしくは個人事業主をご紹介下さい！　全国全業種の対応です。','お客様からいただいた料金の２０％（税込）','自由','直接',17,'株式会社G.C.E','https://www.paralell-carrer.co.jp/works/15#%E3%81%AA%E3%81%97','・自分で採択の可能性のある補助金や助成金をリサーチする必要がない。\r\n・採択の可能性が低い助成金や補助金の申請書類を作るのに勉強したり、作成したり、出しに行ったりしなくてもよい。\r\n・完全成果報酬なので、リスクがない。');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (34,'【仕入れ０円】完全自動の物販スクール','【インタビュー動画】\r\nhttps://youtu.be/SRmixJQ430w\r\n\r\n仕入金０で取り組める完全自動物販で稼ぎたい方をご紹介お願いします。物販初心者大歓迎！\r\n\r\nネット物販は昨今でも右肩上がりに成長している市場で、ネットの普及により誰でもチャレンジしやすい環境なりました。\r\n\r\n物販に必要な、勉強(リサーチ・仕入)＋販売を全て網羅したコンテンツのご提供になります。\r\n\r\n中国輸入であったり仕入れ先のご紹介、初心者の方向けのリスク０の無在庫販売、実際にこれまで指導してきた、３０万以上利益を作る中国輸入の教育動画もございます。\r\n\r\n例え、「２００円で仕入できて安い！！これなら売れる！」と思ったとしても、販売力がなければただの在庫になります。\r\n\r\nSellesでは販売に特化した、４モール対応の自動出品システムもご提供させて頂きます。例えば、不用品を売るとき、「出品するのめんどくさいな」と思う方が多いと思いますが、そのめんどくさい作業を全てシステムがやってくれます。\r\n\r\n基礎知識＋ノウハウ＋販売を全て網羅したSellers。\r\n定額の１２,８００円/月でご提供させて頂きます。\r\n\r\n少しでも副収入が欲しい方がいればご紹介くださいませ！','ご紹介していただいた方が契約になれば、御紹介者様のお支払い金額の毎月１０％をご紹介料としてお支払いさせていただきます。',3,'2021-08-15 20:35:31','2021-12-03 22:37:39',2,'1dqJwZP5C0tHZPYG4DRYOSfgHE1udf8CNTSp5Gh9FVkM',NULL,'全国','月末締めの翌々月１５日支払い','仕入金０で取り組める完全自動物販で稼ぎたい方をご紹介お願いします。物販初心者大歓迎！物販に必要な、勉強(リサーチ・仕入)＋販売を全て網羅したコンテンツのご提供になります。','御紹介者様のお支払い金額の毎月１０％','口コミ・チラシ・サイト作成など基本的になんでも可能です。','特に指定はありません',18,'株式会社MTS','https://sellers2019.studio.site','６ヶ月以内に３０万円利益を作るようなシステムが御座いますのでご安心ください。\r\n出品販売・発送業務など全て自動化しており、忙しい方でも収入を得やすい所が弊社の強みになります。');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (35,'賃貸物件を探している方をご紹介ください！','引越しする方をご紹介ください。  ネットに載ってる物件や未公開物件を安くご案内します。  また他社で内見した物件の見積もりを共有して頂ければ、他社より安くご案内させていただきます。','最大報酬額は家賃の５０％です。\r\n\r\nお友達やネットで集客し見込み客をご紹介ください！\r\n\r\n物件により大家さんから頂ける広告費（AD）によって最大報酬額は変動し、最低でも家賃２０％の報酬になります。\r\n\r\n例：家賃１０万円の物件の場合、２万円の報酬になります。（AD２００%の場合、５万円になります）',3,'2021-08-15 20:38:24','2021-08-15 20:59:32',2,'1a3Y25TUyhzOdcv-zGUVNSlRq66jFm3g4KGMS28SBlLg',NULL,'全国どこでも可能','月末締め翌々月１５日払い','引越しする方をご紹介ください。 ネットに載ってる物件や未公開物件を安くご案内します。  また他社で内見した物件の見積もりを共有して頂ければ、他社より安くご案内させていただきます。','家賃の２０％～５０％（税込）','お任せいたします。','口コミ・チラシ・サイト作成など基本的になんでも可能です。口コミ以外の場合はご相談ください。',19,'渋谷に本社がある企業です。詳細御希望の方は『掲載主から詳細を聞く』を押してください。','#なし','同じ賃貸物件でも必ず他社よりも必ず安い値段で契約が可能です！');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (36,'通信費をコスト削減したい法人をご紹介ください！','既に通信機器がありコストを削減されたい方、もしくは新しくオープンする事業所をご紹介ください。\r\n弊社がキャリアやメーカーと交渉し特価でご提供させていただきます。','■フレッツ光  ・料金 月額４０００円台（エリア、タイプによって微差あり） \r\n報酬：１２５００円  \r\n\r\n■ソフトバンク携帯（５０GB、カケホ）   ・料金 月額４４８０円　 端末代金別途  \r\n報酬：１台２０００円\r\n  ※１０台以上の場合、 特別プラン有 キャリアと交渉し弊社独自の毎月報酬方式へ\r\n\r\n  ■無制限ポケットWi-Fi （１日３GB以上利用時制限有）  ・料金 月額　３４８０円 端末代金込み  \r\n報酬：２０００円\r\n\r\n  ■データ２０GBタブレット （iPad、Android）  ・料金 月額４４８０円 端末代金込み  \r\n報酬：２０００円\r\n \r\n■複合機 （メイン京セラ）  ・料金 本体代は 基本６年リース月額１２０００円   カウンター 白黒０．７円、カラー７円  \r\n報酬：２５０００円\r\n\r\n  ■UTM（セキュリティ機能）・料金 本体代は 基本的に６年リース月額１２０００円   \r\n報酬：２５０００円 \r\n\r\n■電話工事、LED工事、パソコン、防犯カメラ  \r\n報酬：設置内容によって変わるため粗利の１０%',3,'2021-08-15 20:44:41','2021-08-15 20:59:51',2,'13d2ACtwPndWRA3YKDjrKN1eZfB9TdCcqm-m3pclluG0',NULL,'全国','納品月・開通月の翌々月１５日','通信機器が必要orコスト削減をしたい法人様・個人事業主様をご紹介ください','一度ご紹介いただくと通信機器が契約になる度に報酬に繋がります。全ての商品が１台から契約可能です。※詳細画面をご確認ください','お任せいたします。','お任せいたします。',20,'日本ネットワークコミュニケーションズ株式会社','http://nncom.co.jp/','通信費削減！\r\n要望を弊社にお伝えいただくだけで弊社がキャリアメーカーから都度特別条件を取得いたします。');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (37,'【スタイリー不動産】不動産購入・売却・不動産投資をお考えのお客様を御紹介ください！','不動産の売却や購入、不動産投資をお考えのお客様をご紹介いただくお仕事です。\r\n\r\n\r\n▶お知合いにこのようなお悩みや不安をお持ちの方はいらっしゃいませんか？\r\n\r\n☆なかなかお金が貯まらない…\r\n\r\n☆将来の生活が不安、お金には困りたくない…\r\n\r\n☆お金を賢く増やしていきたい…\r\n\r\n☆投資や資産運用には興味はあるけど、何からはじめれば良いのか分からない…\r\n\r\n☆税金が高いので何とかしたい…などなど\r\n\r\n\r\n\r\n▶ご安心ください!!そのお悩み解決します!!\r\n\r\n上記に1つでも該当する方がいらっしゃれば、是非弊社にご紹介ください!!','売買利益の２５%が報酬です。売買利益とは事務手数料１０万円を引いた金額から２５%となり、物件によって契約書作成や契約事務手数料がかかる場合もあります。\r\n\r\n例：価格３０００万円の物件で売主と飼い主から各々３%の手数料の場合、４２．５万円の報酬になります。',3,'2021-08-15 22:38:38','2021-11-14 21:14:08',2,'1vdrEnmrA8T6pK0RH7rQs7R1CEkrfDV8d4FseWdfN5_Y',NULL,'主に大阪、兵庫、東京（全国可能です。）','売上金着金した月締め、翌月末支払い','大阪、兵庫中心に不動産の売却や購入をお考えのお客様をご紹介いただくお仕事です。基本的にはお客様を見つけていただきご紹介いただく形になっております。','売買利益の２５%','口コミ（その他営業方法をお考えの方はご相談ください。）','口コミを推奨しております。その他ご相談あればお気軽にお問い合わせください。',22,'翔星建設株式会社','http://shoseikensetsu.co.jp/','各エリアに強い担当と、提携会社がいるので適正価格での取引が可能です！\r\n相見積もりしていただければ確実にお安くできます！');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (38,'脱毛サロンにお得に通いたい方をご紹介ください！（東京）','メンズ•レディース問わず脱毛にご興味ある方をご紹介ください！当店は完全招待生の脱毛サロンとなっております。 \r\n\r\n※お客様には店頭で「パラキャリ割で」と伝えていただくようにご案内をお願いいたします！！\r\n\r\n✭２０２１メンズ「パラキャリ割特別価格」（１回あたり）\r\n\r\n全顔&首=１万円\r\n両わき=３０００円\r\nVIO=１万２０００円 (VIO単品は各５０００円)\r\n両腕=１万２０００円\r\n両足=１万５０００円(ひざ上、ひざ下 各７０００円)\r\nお腹=８０００円\r\n胸=８０００円\r\n背中=１万円\r\n\r\nまとめて割引\r\n全身=６万円\r\n全身(顔 or VIO抜き)=５万５０００円\r\n両腕+両足=２万５０００円\r\n全顔&首+両足=２万３０００円\r\n\r\n\r\n✭２０２１レディース「パラキャリ割特別価格」（１回あたり）\r\n\r\n全顔&首=６０００円\r\n両わき=３０００円\r\nVIO=７０００円(VIO単品は各３０００円)\r\n両腕=７２００円\r\n両足=７２００円(ひざ上、ひざ下 各４０００円)\r\nお腹=５０００円\r\n胸=５０００円\r\n背中=６０００円\r\n\r\nまとめ割引\r\n全身=２万５０００円','お客様からいただいた金額の７．５%をお支払いいたします。',4,'2021-08-15 22:52:23','2021-11-14 21:12:57',2,'10NPrPInsNeCGvYtIDsqiqHMCTolIdhVRAY5yh4X7OgI',NULL,'東京都渋谷区代々木３丁目','月末締めの翌月の１５日払い','メンズ•レディース問わず脱毛にご興味ある方をご紹介ください！','契約していただいた内容の７．５%をお支払いいたします。','お任せいたします。','お任せいたします。',21,'atlantis beauty','https://www.instagram.com/atlantis_beauty_group','他店よりも安く脱毛をすることができます。');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (39,'【スタイリー不動産】賃貸物件をお得に探されている方をご紹介ください！','【インタビュー動画】\r\nhttps://youtu.be/oXMG7nx29J8\r\n\r\n大阪、兵庫を中心とする近畿エリアでお引っ越しをお考えの方をご紹介いただくお仕事です。近畿エリア以外もご紹介は可能です。\r\n基本的にはお客様を見つけていただきご紹介いただく形になっております。\r\n\r\nその他、業務範囲を広く受けていただける場合は研修の後、報酬形態を変更させていただくことも可能です。\r\n\r\n※事務所、テナントなどのご紹介もお受けしております。ご相談ください。','報酬は発生した売上の２５%としております。\r\n相場の金額としましては１ヶ月分の家賃が１０万円の場合、報酬は２．５万円〜となります。（物件により前後に変動致します。）',3,'2021-08-16 00:38:20','2021-12-03 22:49:48',2,'1RP3MzsvtVWQKUEukNfAKyUWtKSCcsePYsHSbS6H7zFE',NULL,'大阪、兵庫、京都','売上金着金した月締め、翌月末支払い','近畿圏内でお引っ越しを考えられている方をご紹介ください。単身、カップル、ファミリーどなたでも可能です。','売上の２５%','口コミ（その他営業方法をお考えの方はご相談ください。）','口コミを推奨しております。その他ご相談あればお気軽にお問い合わせください。',23,'翔星建設株式会社','http://stylee.info/','①仲介手数料０\r\n②オンラインでお部屋さがしができる\r\n③現地集合で内覧ができる\r\n④おしゃれな不動産多数あり\r\n⑤初期費用のお値下げ交渉可\r\n⑥各エリアの格安のライフライン（電気、ガス、ネットなど）を同時手配');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (40,'国保加入者から社会保険適用者への切り替えサポート','社会保険の具体的なメリットとしては、まずは労使折半による個人の負担額が減ることです。\r\n※本人の所得や居住地などの条件次第では国民健康保険のほうがお得という方もいるので、シュミレーション（見積もり）が必要となります。\r\n　目安としては、年間の国民健康保険料・国民年金保険料の支払総額が４０８０００円以上の方は弊社サポートでお得になります。\r\n\r\nもう一点、将来受給できる老齢年金の額が増えます。(厚生年金加入になるため、２段階目の年金受給権利を得られます。)\r\n例えば３０歳から弊社サポートにより社会保険に加入し６５歳〜１００歳まで年金受給した場合、総額１０００万円程年金受給総額が増加します。\r\nまた、信用力という観点で、クレジット発行時の審査やローンの審査時に好影響を及ぼすことも多いです。\r\n\r\nこれら社会保険加入の魅力をお伝え頂いた上で、弊社担当者にお繋ぎ頂くことで、\r\n疑問点の解消やその後のお手続きを丁寧に全う致します。','一人あたり、ショット報酬として１００００円\r\n紹介数が１０名を超えた場合月々のストック報酬として、紹介数一人につき１０００円\r\n例（紹介者１５名の場合）：入会時ショット報酬累計１５万円、毎月１．５万円の継続収入\r\n\r\n※ストック報酬額については、貢献度により段階的に最大２５００円程度まで昇給有ります。',1,'2021-08-31 19:10:40','2021-11-23 02:46:19',2,'1sFxNFMipq_wsYDWXxqWFCFxrjCsX5TAlxQ_pnuJMlq4',NULL,'全国対応可能','ショット報酬については契約完了翌月末支払い ストック報酬は毎月末(ショット報酬の翌月から)に支払います。','個人事業主（国民健康保険加入）の方々に、社会保険へ加入するメリットをお伝えし、魅力を感じてくださった方を弊社担当者にお繋ぎ頂く仕事です。','一人あたり１００００円（一時金） ＋月のストック報酬（条件有）','紹介営業','紹介営業',24,'株式会社パラレルキャリア','https://www.paralell-carrer.co.jp/works/40','社会保険に切り替えることによる経済的なメリットがあることは勿論ですが、\r\n金融や税務のプロとして、個人の方が成功、拡大していくための環境作りをサポート致します。');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (41,'【無料】ITエンジニア（SE、プログラマー）の方をご紹介ください！','【インタビュー動画】\r\nhttps://youtu.be/8O4FNmWv7LA\r\n\r\nITエンジニア（SE、プログラマー）をご紹介いただき、当社経由でフリーランス転向された場合、ストック型で報酬のお支払いが可能です。\r\nフリーランスや転職はまだ興味がないけど、話しだけでも聞いてみたい方でも相談可能です。\r\n＊派遣も可能です。\r\n\r\n【対象となるエンジニア】\r\n経験言語やエンジニアの種類によりますが、基本２年半以上の実務経験が必要となります。\r\nシステム開発、アプリ開発、PMO、インフラ系、webエンジニア、\r\nデザイナー、ゲーム系、ヘルプデスクetc...\r\n\r\n\r\n【エンジニアが見込めるメリット】\r\n・収入アップ(１．５～２倍以上)\r\n・時短勤務(定時退社)\r\n・キャリアアップ\r\n・税務サポート(顧問税理士が無料で付いて青色申告で対応)','当社経由でのフリーランスとしての参画が決まった場合、\r\n１人１万円(税込)を毎月お支払い。\r\n＊５人決まれば、毎月５万円のストック報酬。',3,'2021-09-11 21:43:27','2021-11-25 21:40:48',2,'1W7faxy6k8Vq4flbQNv6lJ3Lig-rMEjFSdly9pxct1Ng',NULL,'全国どこでも可能','月末締めの翌２５日払い','ITエンジニア（SE、プログラマー）をご紹介いただき、当社経由でフリーランス転向された場合、ストック型で報酬のお支払いが可能です。フリーランスや転職はまだ興味がないけど、話しだけ聞いてみたい方でも相談可能です。＊派遣も可能です。','当社経由でのフリーランスとしての参画が決まった場合、 １人１万円(税込)を毎月お支払い。 ＊５人決まれば、毎月５万円のストック報酬。','お任せいたします。','お任せいたします。',26,'株式会社NKC　ASIA','https://www.nkc-asia.com','【最近の転職実例】\r\n\r\nRさん(２０代後半)\r\nエンジニア歴４年で基本労働時間が９：００〜２０：００で手取り２２万の方が、９：００〜１８：００に変わって月収４９万になりました！！\r\n\r\nFさん(３０代前半)\r\n元不動産会社のSEで手取り１８万、周りにプログラミングを教えてくれる先輩すらいないひどい職場環境で労働時間も一日１２時間オーバーは当たり前になってしまっていた状態。\r\n現在は月収４４万で勤務時間は８：３０～１７：３０に変わりました。');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (42,'携帯電話を格安SIMに切り替えたい方をご紹介ください！','大手キャリアが未だ８０%のシェアを占めてる通信の市場に対し\r\nMVNO(格安SIM)の会社は１０００社ある中で未だ２０%程のシェア率です。\r\n\r\nマインモバイル(MVNO)として\r\n８０%の大手キャリアをお使いの方にお得なご案内になります。\r\n\r\n格安SIMにしたいけど…下記の困りごとを解決します。\r\n\r\n・電波は大丈夫？　　　　　　　\r\n➡️  docomo回線だから安心(マインモバイル会員専用の独自帯域)\r\n\r\n・データは消えない？　　　　　\r\n➡️ アプリも機種もそのまま使えるので大丈夫。\r\n\r\n・サポートがないと不安　　　　\r\n➡️対面サポートやリモート、LINEでのテクニカルサポートがあるので安心。\r\n\r\n・どこでSIMを申込みするの？　\r\n➡️代理店から説明を受けてその場でオンライン申込みが可能。\r\n\r\n登録から設定まで面倒な作業を代理店が徹底サポート致します。\r\n\r\n今お使いの料金と比べていただき安くなるようでしたら是非ご利用ください。\r\n\r\n\r\nポケット&ホームWi-FiはCMなどでお馴染みのAUのWiMAXになります。\r\n\r\n端末料金無料で、ギガ制限なしでご利用いただけます。','月額使用料金の１０％を毎月お支払いいたします。',4,'2021-09-11 21:59:45','2021-09-13 22:14:23',2,'1G05E2kyppePZfMWbgod-WZhZ532IkF_KLeqTJYWeYiQ',NULL,'全国対応可能 (関西圏以外はリモート対応になります)','月末締め翌月末払い。お客様は初月無料のため、初回報酬は契約月の翌々月末となります。','格安SIMの携帯電話に切り替えたい方をご紹介ください！','月額使用料金の１０％を毎月お支払いいたします。','先ずはお電話でやりとりしていただいてから、日程調整をし、基本対面にてご説明させていただいておりますが、関西圏外や遠方の方はリモートでの対応になります。','先ずはお電話でやりとりしていただいてから、日程調整をし、基本対面にてご説明させていただいておりますが、関西圏外や遠方の方はリモートでの対応になります。 また、取次代理店として活動も可能です。',27,'G.S.L(取次代理店)','https://minemobile.co.jp','今ご使用の携帯電話の通信料が安くなる。');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (43,'【全車種ご案内可】新車・中古車をご購入予定のお客様を御紹介ください！','・自動車の購入を検討されている方\r\n・乗り換えを検討されている方\r\n・自動車の売却のみ検討されている方\r\n\r\nをご紹介ください！車は全車種ご案内可能ですので、お気軽にご相談いただけると幸いです。','・軽自動車１．５万円\r\n・普通車２．５万円\r\n・輸入車一律５万円\r\n\r\nまとめて台数を購入していただける場合は、報酬は上げられますので都度ご相談ください。',3,'2021-09-11 22:13:44','2021-12-02 23:55:26',2,'1Wd12JaLfQhji7dpa0d3NyquLJnu3WQ-UwySfV0QuOOs',NULL,'全国どこでも可能です。 沖縄、北海道、離島は特別陸送費用追加になります。','入金ベースの月末締め翌月１５日払い。','自動車の購入を検討されている方、乗り換えを検討されている方、もしくは自動車の売却のみをご検討されている方をご紹介ください！','自動車の購入を検討されている方、乗り換えを検討されている方、もしくは自動車の売却のみをご検討されている方をご紹介ください！','お任せいたします。','お任せいたします。',25,'All kinds of cars shops MERYSE','https://www.instagram.com/meryse.2021/','オンライン商談可能ですので、コロナ渦でもご安心いただけます！\r\nまた書類のやりとりも郵送可能です。\r\n\r\n大手ディーラーや大型中古車店舗に比べ、小規模店舗になるので人件費が少なく、\r\nその分利益も抑えているので、同じような車でもお安くご購入していただけます！');
