INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (46,'節税対策にも！！中小、零細企業さんをご紹介ください！(健康経営優良法人認定サポート）','【インタビュー動画】\r\nhttps://youtu.be/5gZMRU1_rZ8\r\n\r\n経済産業省が推奨する認証「健康経営優良法人」の認証取得のお手伝いをしています。 「健康経営優良法人」を取得することで\r\n・金融機関でのスコアリング加点\r\n・求人募集への応募数４倍\r\n・離職率３分の１への低下\r\n・企業ブランディング\r\nなどメリットが多数あります。 こちらの認定申請と全従業員様向けの福利厚生制度をパッケージにしてご提供しておりま す。\r\n\r\n料金は税込３３万円、税込４４万円、税込５５万円と３種類ございます。全額経費算入が可能で、さらにそれぞれの金額の税抜き価格（３０万円・４０万円・５０万円）は助成金によって返ってきます。つまり企業様の金銭的負担は３万円・４万円・５万円のみとなります。詳細をご希望の方はお気軽に「掲載主から詳細を聞く」ボタンを押していただければと思います。\r\n\r\n【弊社の強み】\r\n・認定取得率９８％（約２０００社の実績）\r\n・女性アドバイザーによる親身な対応','ご紹介いただいた企業様がパッケージのご契約で紹介料 ２．５万円（税込）',3,'2021-10-10 23:49:30','2021-11-25 21:02:25',2,'1DGkbxou47q88t3s1P5rVSTwVNhHi0l7zqwQHwABsz-U',NULL,'全国どこでも可能。','ご紹介いただいた企業様が契約された日の翌々月の５日','お知り合いの企業様をご紹介ください。 経済産業省が推奨する「健康経営優良法人」の認証取得のお手伝いをしています。','ご紹介いただいた企業様がパッケージのご契約で紹介料 ２．５万円','お任せいたします。','お任せいたします。',29,'1st class','https://www.paralell-carrer.co.jp/works/46','・全額損金で経費削減\r\n・企業ブランド力のアップ（経産省）の HP に優良企業として掲載される\r\n・求人力アップ→ハローワーク求人欄に特別欄有\r\n・金融機関評価アップ→融資を受ける際に有利に\r\n・離職率の低下');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (47,'【完全無料】分譲マンションにお住まいの方をご紹介ください！（アンケートに答えてくれるだけで５０００円）','【インタビュー動画】\r\nhttps://youtu.be/tX1JTodjrAQ\r\n\r\n分譲マンションにお住まいの方をご紹介ください！３０分の簡単なアンケートに答えてくれるだけで５０００円お渡しします。\r\n\r\n【条件】\r\n①５０室以上で築８年以上のマンションにお住まいの方\r\n②分譲マンションの区分所有者（賃貸ではなく購入している住人の方）\r\n\r\nアンケートにお答えいただいた方には、弊社サービスをご案内させていただきます。\r\n\r\n（分譲マンションに住んでいる方の殆どが管理費・修繕積立金の値上げりの仕組みをしりません。必要のない値上げをされているマンションが大半です。仕組みを知り、それらを防ぐための取り組みにご協力していただける方を募集しております。料金は一切かかりません。）\r\n\r\n全てのマンションの住人様にアンケートに伺える訳ではなく、上記二つの条件に当てはまる方の約半分の方となります。恐れいりますが、当案件をご紹介いただける際には、詳細欄にマンション名をご記載していただくように宜しくお願いいたします。','ご紹介していただいた住人の方がアンケートにお答えいただいたら税込５０００円。さらに、ご紹介いただいた住人さんが取り組みに協力合意（完全無料）していただけたら追加で税込５万円お渡しします。',3,'2021-10-12 23:02:34','2021-11-25 21:08:40',2,'1fuLDLKd2gJWcWBAzICRTrdKlGA05_yldbCy28qqo8UA',NULL,'関西（大阪・兵庫・京都・滋賀・奈良）関東（東京・千葉・埼玉・神奈川）','お客様がアンケートにお答えいただく、もしくは誓約書に同意していただいた翌月の２５日。','分譲マンションにお住まいの方をご紹介ください！３０分の簡単なアンケートに答えてくれるだけで５０００円お渡しします。','ご紹介していただいた住人の方がアンケートにお答えいただいたら税込５０００円。さらに、ご紹介いただいた住人さんが取り組みに協力合意していただけたら追加で税込５万円お渡しします。','お任せいたします。','お任せいたします。',28,'株式会社バランシズム','https://www.balancism.com','・アンケートに答えていただくだけで５０００円の商品券をその場でお渡しします。（アンケートはご希望の場所に弊社女性社員が伺います）\r\n・更に活動にご協力いただける方には別途２０万円～５０万円の協力活動費をお渡しさせていただきます\r\n・お客様からは料金は一切いただきませんのでご安心ください。');
INSERT INTO works (id, title, content, reward, status, created_at, updated_at, provider_id, sheet_id, google_account, abailable_area, payment_date, work_overview, reward_overview, form_overview, form_detail, display_order, company_name, company_hp, customer_benefit) VALUES (48,'国保加入者から社会保険適用者への切り替えサポート','社会保険の具体的なメリットとしては、まずは労使折半による個人の負担額が減ることです。\r\n※本人の所得や居住地などの条件次第では国民健康保険のほうがお得という方もいるので、シュミレーション（見積もり）が必要となります。\r\n　目安としては、年間の国民健康保険料・国民年金保険料の支払総額が４０８０００円以上の方は弊社サポートでお得になります。\r\n\r\nもう一点、将来受給できる老齢年金の額が増えます。(厚生年金加入になるため、２段階目の年金受給権利を得られます。)\r\n例えば３０歳から弊社サポートにより社会保険に加入し６５歳〜１００歳まで年金受給した場合、総額１０００万円程年金受給総額が増加します。\r\nまた、信用力という観点で、クレジット発行時の審査やローンの審査時に好影響を及ぼすことも多いです。\r\n\r\nこれら社会保険加入の魅力をお伝え頂いた上で、弊社担当者にお繋ぎ頂くことで、\r\n疑問点の解消やその後のお手続きを丁寧に全う致します。','協会加入中はストック報酬として毎月２５００円',3,'2021-11-23 02:52:28','2021-11-23 02:57:15',2,'1KY8JzrVOa-KHVYskdie9IsJ4HBLGRzKjy91rPTthgwo',NULL,'全国','月末締め翌月払い','個人事業主（国民健康保険加入）の方々に、社会保険へ加入するメリットをお伝えし、魅力を感じてくださった方を弊社担当者にお繋ぎ頂く仕事です。','協会加入中はストック報酬として毎月２５００円','口コミ','口コミ',30,'株式会社パラレルキャリア','#なし','社会保険に切り替えることによる経済的なメリットがあることは勿論ですが、\r\n金融や税務のプロとして、個人の方が成功、拡大していくための環境作りをサポート致します。');
